import { TransactionList } from './components/TransactionList';


function App() {
  return (
    <>
    <div className="App">
      <Header/>
      <div className="balance">
        <Balance/>
        <IncomeExpense/>
        <TransactionList/>
        <AddTransaction/>
      </div>

    </div>
    </>
  );
}

export default App;
